import logo from './logo.svg';
import './App.css';

let canvas;
let context;

let bee = {
  xpos,
  ypos,
  xvelocity,
  yvelocity,
  img: new Image()
};

function update() {
  setTimeout(() => {
    canvas.width = document.body.offsetWidth;
    canvas.height = document.body.offsetHeight + 27;
  }, 5)
}

function App() {

  canvas = document.getElementById("bee-game");
  context = canvas.getContext("2d");

  canvas.width = document.body.offsetWidth;
  canvas.height = document.body.offsetHeight + 27;

  return (
    <div className="App">
      <header className="App-header">
        <canvas id="bee-game"></canvas>
      </header>
    </div>
  );
}

export default App;
